import React from 'react'
import { FlightData } from '../../models/FlightData';
import { IoIosSettings, IoIosWarning, IoMdInformationCircle } from "react-icons/io";
import { IoAirplaneSharp } from "react-icons/io5";
import InfoFlight from './InfoFlight';

const Flight: React.FC = () => {
    const [flights, setFlights] = React.useState<FlightData[]>([]);
    const [loading, setLoading] = React.useState<boolean>(false);
    const [error, setError] = React.useState<string>("");

    if (loading) {
        return <h1>Đang tải...</h1>
    }
    if (error) {
        return <h1>{error}</h1>
    }

    return (
        <div className="max-w-6xl mx-auto bg-white p-20 shadow-lg">
            <div className="flex justify-between">
                <div className='flex'>
                    <img
                        src="https://i.pinimg.com/originals/7a/ec/17/7aec17946661a88378269d0b642b61f3.png"
                        alt="Vietnam Airlines"
                        className="h-12 mr-10"
                    />
                    <div className='max-w-2xl'>
                        <div className="text-2xl font-bold">Vietnam Airlines 11</div>
                        <div className="text-green-800 font-bold mt-4">EN ROUTE AND ON TIME</div>
                        <div className="text-lg text-green-600 mb-4">Arriving in 5 hours 55 minutes</div>
                    </div>
                </div>
                <div>
                    <IoIosSettings color='blue' className='size-5 hover: cursor-pointer' />
                    <IoMdInformationCircle className='size-5 mt-2 hover: cursor-pointer' />
                </div>
            </div>

            <InfoFlight/>
        </div>
    )
}

export default Flight
